import React from "react";
import { useState } from "react";
const Google = () => {
  const [priceValue, setPriceValue] = React.useState(30);
  const [modelOpen, setModelOpen] = React.useState(false);

  return (
    <div
      style={{
        paddingTop: "60px",
        paddingBottom: "120px",
        display: "flex",
        justifyContent: "space-between",
        width: "90%",
      }}
    >

      {modelOpen && <div>
        <>
                <div className="fixed z-[2000] top-0 left-0 right-0 bottom-0 bg-black opacity-60"></div>
                <div className="fixed z-[2000] top-0 left-0 right-0 bottom-0 flex items-center justify-center customMargins   ">
                  <div className="flex sm:p-4 p-2 flex-col text-[20px] leading-tight font-bold justify-center  scr420:gap-4 gap-3 min-w-[300px]  bg-white rounded-[16px]  ">
                    <div className="flex justify-between">
                      Difficulty Level
                      <div
                        onClick={() => {
                          setisLevel(false);
                        }}
                        className="cursor-pointer"
                      >
                        <CloseIcon />
                      </div>
                    </div>
                    <div className="flex sm:gap-4 gap-2 justify-between sm:text-[16px] text-[14px] font-medium">
                      <div>
                        <label className="flex gap-2 items-center">
                          <input
                            className="h-[15px] w-[15px]"
                            type="radio"
                            name="level"
                            value="Easy"
                            onChange={handleLevelChange}
                            checked={level === "Easy"}
                          />
                          Easy
                        </label>
                      </div>
                      <div>
                        <label className="flex gap-2 items-center">
                          <input
                            className="h-[15px] w-[15px]"
                            type="radio"
                            name="level"
                            value="Intermediate"
                            onChange={handleLevelChange}
                            checked={level === "Intermediate"}
                          />
                          Intermediate
                        </label>
                      </div>
                      <div>
                        <label className="flex gap-2 items-center">
                          <input
                            className="h-[15px] w-[15px]"
                            type="radio"
                            name="level"
                            value="Advanced"
                            onChange={handleLevelChange}
                            checked={level === "Advanced"}
                          />
                          Advanced
                        </label>
                      </div>
                    </div>
                    <div className="w-full flex justify-end">
                      <button
                        onClick={() => {
                          toggleContent();
                          setisLevel(false);
                        }}
                        className={`flex justify-center items-center w-[90px] py-1 text-[16px]
                              bg-blue rounded-[8px] text-white
                              }`}
                      >
                        {" "}
                        Start
                      </button>
                    </div>
                    {/* <div className="flex flex-col gap-2 font-medium justify-center items-center ">
                      <div className="ml:w-[380px] scr390:w-[342px] w-[290px] flex flex-col gap-2 ">
                        Difficulty Level
                        <div className="flex scr390:text-[14px] text-[13px] font-medium rounded-[6px] p-[6px] border border-[#DEDEDE] scr390:w-[342px] w-[290px]">
                          <button
                            onClick={() => { setLevel("Easy"); setisLevel(false) }}
                            className={`flex justify-center items-center w-[109px] py-1 ${level === "Easy" && "bg-blue rounded-[4px] text-white"
                              }`}
                          >
                            {" "}
                            Easy
                          </button>
                          <button
                            onClick={() => { setLevel("Intermediate"); setisLevel(false) }}
                            className={`flex justify-center items-center w-[109px] py-1 ${level === "Intermediate" &&
                              "bg-blue rounded-[4px] text-white"
                              }`}
                          >
                            {" "}
                            Intermediate
                          </button>
                          <button
                            onClick={() => { setLevel("Advanced"); setisLevel(false) }}
                            className={`flex justify-center items-center w-[109px] py-1 ${level === "Advanced" &&
                              "bg-blue rounded-[4px] text-white"
                              }`}
                          >
                            {" "}
                            Advanced
                          </button>
                        </div>
                      </div>
                    </div> */}
                  </div>
                </div>
              </>
        </div>}
      <div
        style={{
          width: "100%",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          flexDirection: "column",
          gap: "10px",
        }}
      >
        <div
          style={{
            fontSize: "50px",
            width: "50%",
            fontWeight: "600",
            paddingLeft: "80px",
          }}
        >
          <span style={{ color: "red" }}>Airbnb it.</span>
        </div>
        <div style={{ fontSize: "50px", fontWeight: "600" }}>
          You could earn
        </div>
        <div style={{ fontWeight: "600", fontSize: "60px",alignItems:"center",display:"flex",flexDirection:"column" }}>
          ${priceValue}{" "}
        <p style={{fontSize:"20px"}}> {10} nights at an estimated ₹3,581 a night</p>
        </div>
        <div>
          <input
            type="range"
            name="destination"
            id="destination"
            min="150"
            max="1000"
            value={priceValue}
            step="10"
            onChange={(e) => setPriceValue(e.target.value)}
            style={{ width: "360px" }}
          />
        </div>
        <div style={{paddingBottom:"20px"}}>Learn how we estimate your earnings</div>

        <div onClick={()=> setModelOpen(true)} className="l" style={{display:"flex",flexDirection:"row",alignItems:"center",gap:"20px"}}>
          <div >
            <img style={{height:"24px"}} src="./img/s.png" alt="" />
          </div>
          <div>
            <div style={{fontWeight:"500"}}>Pune</div>
            <div style={{opacity:"0.6"}}>Entair Place .2 Bedrooms</div>
          </div>
        </div>
      </div>
      <div style={{ width: "50%" }}>
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d242117.70906659198!2d73.69815111553402!3d18.524870612981903!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bc2bf2e67461101%3A0x828d43bf9d9ee343!2sPune%2C%20Maharashtra!5e0!3m2!1sen!2sin!4v1716360540118!5m2!1sen!2sin"
          width="600"
          height="450"
          style={{ border: "0" }}
          allowfullscreen=""
          loading="lazy"
          referrerpolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
    </div>
  );
};

export default Google;
